sanityChecks.promptOutput:
{
  "hasMaterialIssues": true,
  "overallAssessment": "The tables form a generally coherent inventory and sales model, but there are material gaps in how receipts and shipments interact with product quantities and duplicated shipping cost fields that could cause inconsistent data and unclear business processes.",
  "tableIssues": [
    {
      "tableName": "Receipt",
      "issueType": "missing_context",
      "severity": "high",
      "description": "The receipt table only stores po_id, whs_id, rcv_dt and notes. It lacks any reference to the specific products received or the quantities, making it impossible to reconcile receipts with purchase order lines or inventory levels.",
      "affectedTables": ["PurchaseOrderLine", "Inventory"],
      "suggestedFix": "Add columns such as prd_id (product) and rcv_qty (quantity received) or create a ReceiptLine table that references po_id and links to PurchaseOrderLine to capture per‑item receipt details."
    },
    {
      "tableName": "SalesOrderHeader",
      "issueType": "business_logic",
      "severity": "medium",
      "description": "Shipping cost is stored both in the order header (ship_amt) and again in the Shipment table (cost). This duplication can lead to inconsistencies if the two values diverge.",
      "affectedTables": ["Shipment"],
      "suggestedFix": "Choose a single source of truth for shipping cost – either keep it only on the Shipment record and calculate order totals from shipments, or store it only on the order header and remove the cost column from Shipment."
    },
    {
      "tableName": "InventoryAdjustment",
      "issueType": "relationship_inconsistency",
      "severity": "low",
      "description": "The adjustment table records qty changes but does not explicitly reference the Inventory table or define how adjustments affect the on‑hand quantity, leaving the relationship ambiguous.",
      "affectedTables": ["Inventory"],
      "suggestedFix": "Document that adj_qty should be applied to Inventory.qty (or create a trigger/process description) and consider adding a foreign key to Inventory (prd_id, whs_id) for clarity."
    }
  ],
  "crossTableObservations": [
    {
      "observation": "Several tables (SalesOrderHeader, Shipment, PurchaseOrderHeader) store shipping‑related amounts separately, which can cause duplicated data and reconciliation challenges.",
      "tables": ["SalesOrderHeader", "Shipment", "PurchaseOrderHeader"]
    },
    {
      "observation": "Receipt and InventoryAdjustment tables lack direct product/quantity linkage, creating gaps in the flow from purchase to stock levels.",
      "tables": ["Receipt", "InventoryAdjustment", "Inventory", "PurchaseOrderLine"]
    }
  ]
}
